import Header from "./Header";
import notfound from '../images/notfound.svg';
function NotFound (){

return (
	<div className="page">
		 <Header />
		 <div className="not__found">
			<img className="not__found-img" src={notfound} alt="Страница не найдена" />
			<h3 className="not__found-title">
			  Ошибка 404
			</h3>
			<p className="not__found-text">
			  Страница не найдена
			</p>
		 </div>
	  </div>


	)
}

export default NotFound;
